function getComponentsNameRecursive(components, result) {
    if (!components || components.length <= 0) return [];
    for (let i = 0; i < components.length; i++) {
        let configs = componentsConfig.filter(x => x.name == components[i]);
        let config = (configs && configs.length > 0) ? configs[0] : null;
        if (config) {
            if (result.filter(x => x.name == config.name).length <= 0) {
                result.push({ name: config.name, path: config.path });
                getComponentsNameRecursive(config.children, result);
            }
        }
    }
}

let resourceContentCaches = [];
let resourceUrlCaches = [];

function getResourceContent(url) {
    return new Promise((resolve) => {
        let caches = resourceContentCaches.filter(x => x.url == url);
        let cache = caches.length > 0 ? caches[0] : null;

        if (cache) {
            if (cache.handled) {
                resolve(cache.value);
                return;
            }

            let timer = setInterval(() => {
                if (cache.handled) {
                    resolve(cache.value);
                    clearInterval(timer);
                }
            }, 5);
        } else {
            cache = {
                url: url,
                value: null,
                handled: false,
                handler: new Promise((resolve1) => {
                    fetch(url).then(r => r.text()).then(text => {
                        cache.value = text;
                        cache.handled = true;
                        cache.handler = null;
                        resolve1(text);
                    });
                })
            };
            resourceContentCaches.push(cache);
            cache.handler.then(content => resolve(content));
        }
    });
}

function getResourceUrl(url) {
    return new Promise((resolve) => {
        let caches = resourceUrlCaches.filter(x => x.url == url);
        let cache = caches.length > 0 ? caches[0] : null;

        if (cache) {
            if (cache.handled) {
                resolve(cache.value);
                return;
            }

            let timer = setInterval(() => {
                if (cache.handled) {
                    resolve(cache.value);
                    clearInterval(timer);
                }
            }, 5);
        } else {
            cache = {
                url: url,
                value: null,
                handled: false,
                handler: new Promise((resolve1) => {
                    fetch(url).then(r => r.blob()).then(blob => {
                        cache.value = URL.createObjectURL(blob);
                        cache.handled = true;
                        cache.handler = null;
                        resolve1(cache.value);
                    });
                })
            };
            resourceUrlCaches.push(cache);
            cache.handler.then(value => resolve(value));
        }
    });
}

async function importPage(name) {
    let configs = pagesConfig.filter(x => x.name == name);
    let config = (configs && configs.length > 0) ? configs[0] : null;
    if (!config) throw `unable to find page with name '${name}'`;
    let page = await import(`/pages/${name}/${name}.js`);
    let pageHtml = await getResourceContent(`/pages/${name}/${name}.html`);

    if (!page.default.components) page.default.components = {};
    let components = config.components;
    if (components && components.length > 0) {
        for (let i = 0; i < components.length; i++) {
            let component = await importComponent(components[i], []);
            page.default.components[components[i]] = component.default;
        }
    }

    let pageStyle = await importPageStyle(name);
    page.default.template = `
    <div class='page ${name}-page' v-bind:class="$root.size==1?'page-sm':''">
        ${pageStyle}
        ${pageHtml}
    </div>
    `;
    let pageMixin = await import('/mixins/pageMixin.js');
    page.default.mixins = [pageMixin.default];
    page.default.meta = { name: name };
    return page;
}

function pageLoading(isFinish = false) {
    let id = 'pageLoading';
    if (isFinish) {
        document.querySelector("#vue-app").style.opacity = 1;
        document.getElementById(id)?.remove();
    } else {
        document.querySelector("#vue-app").style.opacity = 0;
        let element = document.createElement('div');
        element.id = id;
        element.innerHTML = `
        <svg viewBox="0 0 1024 1024" version="1.1" xmlns="http://www.w3.org/2000/svg">
            <path d="M512 213.333333a298.666667 298.666667 0 1 0 0 597.333334 298.666667 298.666667 0 0 0 0-597.333334z m-384 298.666667a384 384 0 1 1 768 0 384 384 0 0 1-768 0z" fill-opacity=".32" fill="#8a2be2"></path>
            <path d="M723.2 300.8a298.666667 298.666667 0 0 0-422.4 0 42.666667 42.666667 0 0 1-60.330667-60.330667 384 384 0 0 1 543.061334 0A42.666667 42.666667 0 0 1 723.2 300.8z" fill="#8a2be2"></path>
        </svg>
        `;
        document.body.appendChild(element);
    }
}

async function importPageStyle(name) {
    let styles = '<section>';

    //page styles
    let pageStyleUrl = await getResourceUrl(`/pages/${name}/${name}.css`);
    styles += `<link rel='stylesheet' href='${pageStyleUrl}'/>`;

    let metas = pagesConfig.filter(x => x.name == name);
    let meta = (!metas || metas.length <= 0) ? null : metas[0];
    if (meta) {
        //static styles
        let staticStyles = meta.styles || [];
        for (let i = 0; i < staticStyles.length; i++) {
            let staticStyleUrl = await getResourceUrl(staticStyles[i]);
            styles += `<link rel='stylesheet' href='${staticStyleUrl}'/>`;
        }
    }
    styles += '</section>';
    return styles;
}

async function importComponent(name, imported) {
    imported.push(name);
    let configs = componentsConfig.filter(x => x.name == name);
    let config = (configs && configs.length > 0) ? configs[0] : null;
    if (!config) throw `unable to find component with name '${name}'`;
    let path = config.path ?? config.name;

    let component = await import(`/components/${path}/${name}.js`);
    let componentHtml = await getResourceContent(`/components/${path}/${name}.html`);
    let componentMixin = await import('/mixins/componentMixin.js');

    component.default.template = componentHtml;

    if (!component.default.components) component.default.components = {};
    let childComponents = config.children || [];
    if (childComponents && childComponents.length > 0) {
        for (let i = 0; i < childComponents.length; i++) {
            if (imported.filter(x => x == childComponents[i]).length <= 0) {
                let childComponent = await importComponent(childComponents[i], imported);
                component.default.components[childComponents[i]] = childComponent.default;
            }
        }
    }
    component.default.meta = { name: name };
    if (component.default.mixins) {
        component.default.mixins.splice(0, 0, componentMixin.default);
    } else {
        component.default.mixins = [componentMixin.default];
    }
    return component;
}

